    public function setImage(int $image): void
    {
        $this->image = (string) $image;
    }


    public function update(): bool
    {
        Extensions::runHooks('_user_prepare_update',[&$this]);
        $updated = time();
        $user = $this->getUser();
        $this->updated = $updated;
        $columns = array_keys($user);
        $columns = array_map(function ($item){
            if($item !== 'uid' && $item !== 'password' && $item !== 'created' && $item !== 'role' && $item !== 'active'){
                return $item;
            }
        },$columns);
        $columns = array_filter($columns);
        $placeholders = array_map(function ($item){
            return $item .' = :'.$item;
        },$columns);
        $query = Database::database()->prepare("UPDATE users SET ".implode(', ', $placeholders)." WHERE uid = :uid");
        foreach($columns as $column){
            $query->bindValue(':'.$column, $this->$column);
        }
        $query->bindParam(':uid', $this->uid);
        Extensions::runHooks('_user_post_update',[&$this]);
        return $query->execute();
    }

    public function delete(): bool
    {
        Extensions::runHooks('_user_prepare_delete',[&$this]);
        $query = Database::database()->prepare("DELETE FROM users WHERE uid = :uid");
        $query->bindParam(':uid', $this->uid);

        Extensions::runHooks('_user_post_delete',[&$this]);
        $flag[] = $query->execute();

        $nodes = Node::loadByOwner($this->uid);
        foreach($nodes as $node){
            $flag[] = $node->delete();
        }
        return in_array(true, $flag);
    }
